        getReporte: function(){
            sap.ui.core.BusyIndicator.show(0); // mostrando la barra de Busy
            //http://tdperpdev.toyotaperu.com.pe:8002/sap/bc/zfiori_cadm?sap-client=100&ID=01&UNAME=C_T77
            var url = urlGlobal + "?sap-client=" + usuarioSap + "&PI_UNAME="+ userName + "&ID=01";
            var thes = this;
            var oTable = this.getView().byId("tblReporte");

            var id_visita = this.getView().byId("id_visita_equipo").getValue();
            var npersonal = this.getView().byId("npersonal").getValue();
            var fechaF = this.getView().byId("fechaF").getValue();

            var elemento={
                'visita_equipo_id':id_visita,
                'pernr':npersonal,
                'fecha':fechaF
            };

            // Obteniendo los datos del reporte
            $.ajax({
                url: url, 
                cache: false,
                type: "POST",
                data: JSON.stringify(elemento),
                success: function(result,status,xhr){
                    $.each(result, function(i, v) {
                        if(v.type != "E"){
                            if(v.fecha != "00000000"){
                                var anio = v.fecha.substr(0, 4);
                                var mes = v.fecha.substr(4, 2);
                                var dia = v.fecha.substr(6, 2);
                                result[i].fechaformat = dia + "." + mes + "." + anio;
                            }
                            else{
                                result[i].fechaformat = v.fecha;
                            }

                            if(v.hora != "000000"){
                                var hora = v.hora.substr(0, 2);
                                var minuto = v.hora.substr(2, 2);
                                var segundo = v.hora.substr(4, 2);
                                result[i].horaformat = hora + ":" + minuto + ":" + segundo;
                            }
                            else{
                                result[i].horaformat = v.hora;
                            }
                            
                            if(parseInt(v.estado_vist_equ) == 1){
                                result[i].estado = "Ingreso";
                            }
                            else if(parseInt(v.estado_vist_equ) == 2){
                                result[i].estado = "Salida";
                            }
                        }
                        else{
                            result=[];
                        }
                    });

                    var oModel = new  JSONModel(result);
                    oTable.setModel(oModel);
                    
                },
                error: function(xhr,status,error){
                    sap.m.MessageBox.error("Error de Conexión");
                },
                complete: function (data) {
                    sap.ui.core.BusyIndicator.hide();
                }
            });
        },

        descargarArchivo: function(evt) {
            var valor = evt.getSource().data("data");
            var files = localStorage["datosLinks"];

            var filtered = JSON.parse(files).filter(function(item){
                return item.correlativo.trim()==valor;         
            });

            var url = filtered[0].link;

            var element = document.createElement('a');
            element.setAttribute('href', url);
            element.setAttribute('target', '_blank');

            element.style.display = 'none';
            document.body.appendChild(element);

            element.click();

            document.body.removeChild(element)
        },

